  return (
    <div className='flex justify-center items-center h-screen w-screen'>
      <div>
      <p className='text-red-400 text-3xl'>Click here to login</p>
        <button onClick={()=>{
            navigate('login')
        }} className='p- bg-gray-500 rounded'>login</button>

<p className='text-red-400 mt-4 text-6xl'>Visit store</p>

        <button onClick={()=>{
            navigate('store')
        }}>Store</button> 
      </div>
       
    </div>
  )
}

export default Home
